import "./App.css";
import Header from "./components/Header/Header";

function App() {
  fetch(
    "http://dataservice.accuweather.com /currentconditions/v1/215854?apikey=vHpVFJikTtHFfeWGvUo8EqmhA5ZX7NAA HTTP/1.1"
  ).then((res) => {
    console.log(res);
  });
  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
